import React from "react";
import { Container, Row, Col } from "react-bootstrap";
// import {Navigation, Footer} from '../components';
const Layout = ({ children }) => {
	return (
		<div>
			{/* Navigation */}
			<main>
				<Container>{children}</Container>
			</main>
			{/* Footer */}
		</div>
	);
};

export default Layout;
